const findFirstCountryByCode = code => {
  let filteredCode = code.match(/\d/g).join("");
  const filteredCountries = allCountries.filter(
    contryArr => contryArr[2] === filteredCode && contryArr[3]
  );

  let country = filteredCountries[0] ? filteredCountries[0][1] : "";

  return country.toUpperCase();
};


const findFirstCountryByAlpha2 = alpha2 => {
  if (!alpha2) return null;

  const filteredCountries = allCountries.filter(
    contryArr => contryArr[1] === alpha2
  );

  let country = filteredCountries[0] ? { country: filteredCountries[0][1], code: filteredCountries[0][2] } : null;

  return country;
};

const getMaskToLibPhoneNumber = libPhoneNumberObj => {
  const contry = libPhoneNumberObj ? libPhoneNumberObj.country : "";

  if (!contry) return null;

  const filteredCountries = allCountries.filter(
    contryArr => contryArr[1].toUpperCase() === contry.toUpperCase()
  );

  if (!filteredCountries[0]) return null;

  let mask = filteredCountries[0][3]
    ? filteredCountries[0][3].replace(/\./g, "#")
    : null;

  return {
    mask: addCountryCodeToMask(mask, filteredCountries[0][2]),
    countryCode: `+${filteredCountries[0][2]}`
  };
};

const isCanada = number => {
  let filteredNumber = number.match(/\d/g).join("");
  if (filteredNumber.length < 4) return false;
  const areaCode = filteredNumber.substring(1, 4);

  return CanadaAreaCodes.includes(areaCode);
};


